import React from 'react';

import './Button.css'

const Button = ({ text, link }) => {
    return(
        <div style={{ textDecoration: 'none' }}>
            <a
              rel="noopener noreferrer"
              href={link}
            >
                <div className="button">
                    {text}
                </div>
            </a>
        </div>
    );
}

export default Button;
